    true,nt"url": null,nt"notes": "<p>The State Cancer Profiles (SCP) web site
    provides statistics to help guide and prioritize cancer control activities at the
    state and local levels.  SCP is a collaborative effort using local and national
    level cancer data from  the Centers for Disease Control and Prevention's National
    Program of Cancer Registries (NPCR)  and National Cancer Institute's Surveillance,
    Epidemiology and End Results Registries (SEER).  SCP address select types of cancer
    and select behavioral risk factors for which there are evidence-based control interventions.
    The site provides incidence, mortality and prevalence comparison tables as well
    as interactive graphs and maps and support data.  The graphs and maps provide visual
    support for deciding where to focus cancer control efforts.</p>n",nt"license_title":
